SET standard_conforming_strings = OFF;
DROP TABLE IF EXISTS "public"."grid" CASCADE;
BEGIN;
CREATE TABLE "public"."grid" ( "ogc_fid" SERIAL, CONSTRAINT "grid_pk" PRIMARY KEY ("ogc_fid") );
SELECT AddGeometryColumn('public','grid','geom',4326,'MULTIPOLYGON',2);
CREATE INDEX "grid_geom_geom_idx" ON "public"."grid" USING GIST ("geom");
ALTER TABLE "public"."grid" ADD COLUMN "poly_id" NUMERIC(10,0);
ALTER TABLE "public"."grid" ADD COLUMN "unique_id" VARCHAR(254);
ALTER TABLE "public"."grid" ADD COLUMN "area_sqkm" NUMERIC(10,0);
COMMIT;
